import CtaArea from './CtaArea'
import ShopAreaTwo from './ShopAreaTwo'
import BlogArea from './BlogArea'
import Brand from './Brand';
import TeamArea from './TeamArea';
import Gallery from './Gallery';


function IndexTwo(){
	return(
        <>
          <Header/>
        <main>
          <SliderTwo/>
          <UpcomingEvent/>
          <GamesAreatwo/>
          <NewGamesArea/>
         {/* <GamesArea/> */}
          {/* <CtaArea/> */}
          <TeamArea />
          <Gallery />
          <Brand />
         {/* <ShopAreaTwo/> */}
          {/* <BlogArea/> */}
        </main>
        <Footer/>
        </>
	)
}

export default IndexTwo
